  String _message;
  List<UsersData> _data;

  String get status => _status;
  String get message => _message;
  List<UsersData> get data => _data;

  GetUsersResponse({String status, String message, List<UsersData> data}) {
    _status = status;
    _message = message;
    _data = data;
  }

  GetUsersResponse.fromJson(dynamic json) {
    _status = json["Status"];
    _message = json["Message"];
    if (json["Data"] != null) {
      _data = [];
      json["Data"].forEach((v) {
        _data.add(UsersData.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["Status"] = _status;
    map["Message"] = _message;
    if (_data != null) {
      map["Data"] = _data.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

